sources.styles/block/container.scss:
.container {
  //можно через mixin
  max-width: 1024px;
  margin: 0 auto;
  padding: 24px 0;
  @media (max-width: 1040px) {
    padding: 24px 20px;
  }
}

sources.styles/block/about-us.scss:
.about-us {
  display: flex;
  justify-content: space-between;
  @media (max-width: 550px) {
    display: flex;
    flex-direction: column;
  }
  &__column {
    width: 50%;
    padding-top: 100px;
    margin-bottom: 100px;
    @media (max-width: 550px) {
      width: 100%;
      padding-top: 50px;
      margin-bottom: 40px;
    }
    &__name {
      font-size: 48px;
      font-weight: 700;
      @media (max-width: 550px) {
        font-size: 36px;
      }
    }
    &--blue {
      color: blue;
    }
    &__title {
      font-size: 24px;
      padding-left: 10px;
    }
    &__text {
      font-size: 16px;
      font-weight: 400;
      padding-left: 10px;
    }
    &__advantages {
      padding-left: 10px;
    }
  }
}

sources.styles/block/title.scss:
.title {
  font-size: 48px;
  font-weight: 700;
  text-transform: uppercase;
  text-align: center;
  &::after {
    content: "";
    display: block;
    height: 24px;
    width: 24px;
    margin: 0 auto;
    background-image: url(./../images/crown.svg);
    background-repeat: no-repeat;
  }
}

sources.styles/block/gallery.scss:
.gallery {
  &__title {
    margin-bottom: 30px;
  }
  &__row {
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-template-rows: 310px;
    justify-content: center;
    gap: 0 20px;
    @media (max-width: 550px) {
      grid-template-rows: 131px;
    }
    @media (min-width: 550px) {
      &--75-25 {
        grid-template-columns: 2fr 1fr;
      }
      &--50-50 {
        grid-template-columns: 1fr 1fr;
      }
      &--25-75 {
        grid-template-columns: 1fr 2fr;
      }
    }
  }
  &__img {
    height: 100%;
    width: 100%;
    object-fit: cover;
    border-radius: 8px;
  }
  &__subtitle {
    margin-top: 24px;
    margin-bottom: 40px;
    font-size: 16px;
    font-weight: 400;
    @media (max-width: 550px) {
      margin-top: 16px;
      margin-bottom: 32px;
    }
    &--link {
      color: blue;
      font-weight: 700;
      text-decoration: none;
    }
  }
  &__view-all {
    display: block;
    width: 154px;
    height: 56px;
    margin: 0 auto 156px;
    font-size: 16px;
    color: #0075ff;
    border: 1px solid  #0075ff;
    border-radius: 5px;
    text-align: center;
    text-decoration: none;
    padding: 19px 0;
    @media (max-width: 550px) {
      width: 100%;
      margin-bottom: 64px;
    }
  }
}

sources.styles/block/footer.scss:
.footer {
  display: flex;
  align-items: flex-end;
  background-image: url(./../images/footer.jpg);
