sources.styles/main.scss:
@import "utils";
@import "fonts";
@import "typography";
@import "block/container.scss";
@import "block/about-us.scss";
@import "block/title.scss";
@import "block/gallery.scss";
@import "block/footer.scss";

%tel-link {
  color: #fff;
  font-size: 12px;
  text-decoration: none;
  font-weight: 700;
}

* {
  box-sizing: border-box;
}

html {
  font-family: "Roboto", sans-serif;
  font-weight: 700;
  font-size: 16px;
  scroll-behavior: smooth;
}

h1 {
  margin: 0;
}

body {
  margin: 0;
  background: $c-gray;
}

.header {
  height: 100vh;
  padding: 24px 0 80px;
  background-image: url(../images/header.jpg);
  background-size: cover;
  background-position: center;

  &__body {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 100%;
  }
  &__top {
    display: flex;
    justify-content: space-between;
    height: 130px;
    &__burger {
      &__label {
        display: block;
        background-image: url(../images/icons/Icon-Burger-menu.svg);
        background-position: center;
        width: 32px;
        height: 32px;
        cursor: pointer;
        &:hover {
          background-image: url(../images/icons/Icon-Burger-menu-hover.svg);
        }
      }

      &__menu-list {
        position: absolute;
        top: -1000%;
        left: 0;
        z-index: 1;
        width: 100vw;
        min-height: 100vh;
        background-color: blue;
        margin: 0;
        padding-top: 145px;
        transition-duration: 0.8s;
      }
      &__toggle {
        display: none;
        &:checked ~ .header__top__burger__label {
          position: relative;
          z-index: 2;
          background-image: url(../images/icons/Icon-Close.svg);
          background-position: center;
          width: 32px;
          height: 32px;
          transition-duration: 1s;
        }
        &:checked ~ .header__top__burger__menu-list {
          visibility: visible;
          top: 0;
        }
      }
    }
    &__logo {
      display: block;
      position: relative;
      z-index: 2;
      width: 136px;
      height: 80px;
    }
    &__tel {
      position: absolute;
      top: 10px;
      right: 48px;
      width: 100px;
      visibility: hidden;
      //что б не сразу пропадал номер
      transition-duration: 0.5s;
      &--link {
        @extend %tel-link;
      }
    }
    &__call {
      position: relative;
      height: 32px;
      &:hover .header__top__call__tel {
        visibility: visible;
      }
      &__img {
        width: 32px;
        height: 32px;
        background-image: url(../images/icons/Icon-Phone-call.svg);
        cursor: pointer;
      }
    }
  }

  &__title {
    font-size: 80px;
    font-weight: 700;
    color: #fff;
    -webkit-text-stroke: 1px black;
    -webkit-text-fill-color: white;
    &::before {
      content: "";
      display: block;
      height: 2px;
      width: 40px;
      border-radius: 1px;
      background-color: #fff;
    }
  }
  //ссылки в list-menu
  &__item {
    padding-bottom: 15px;
  }
  &__link {
    position: relative;
    padding: 8px 0;
    color: #fff;
    border-radius: 15px;
    font-weight: 700;
    font-size: 22px;
    text-decoration: none;
    text-transform: uppercase;

    &:hover::after {
      content: "";
      display: block;
      position: absolute;
      bottom: 0;
      width: 100%;
      height: 1px;
      border-radius: 0.5px;
      background-color: #fff;
    }
  }
  &__item-bottom {
    text-transform: uppercase;
    letter-spacing: 1px;
    //filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
    padding-top: 30px;
    &__tel {
      display: block;
      padding: 8px 0;
      @extend %tel-link;
    }
    &__call-to-order {
      position: relative;
      padding-bottom: 8px;
      @extend %tel-link;
      &::after {
        content: "";
        display: block;
        position: absolute;
        bottom: 0;
        width: 100%;
        height: 1px;
        border-radius: 0.5px;
        background-color: #fff;
      }
    }
  }
}
